'use strict';
let RakeOutController = require('./RakeOutController.js');
let MessageType = require('./MessageType.js');
let RakeOutPriceController = require('./RakeOutPriceController.js');
class RakeOutControllerFactory {
    create(commandFactory, connectionParameters, sessionProvider, messageFactory, messageExecutor, messageRouter, connectionStatusManager, requestNumberGenerator, periodInMilliseconds) {
        let rakeOutCommand;
        rakeOutCommand = commandFactory.createRakeOutCommand(periodInMilliseconds, connectionParameters, messageRouter, messageExecutor, messageFactory, requestNumberGenerator);
        return RakeOutController.create(sessionProvider, messageRouter, connectionStatusManager, rakeOutCommand, MessageType.TradingSessionReceived);
    }
    createRakeOutPrices(commandFactory, connectionParameters, sessionProvider, messageFactory, messageExecutor, messageRouter, connectionStatusManager, requestNumberGenerator, periodInMilliseconds, priceTerminal, rakeOutPriceControllerCallback) {
        let rakeOutCommand;
        rakeOutCommand = commandFactory.createRakeOutPricesCommand(periodInMilliseconds, connectionParameters, messageRouter, messageExecutor, messageFactory, requestNumberGenerator, priceTerminal);
        return RakeOutPriceController.createPriceController(sessionProvider, messageRouter, connectionStatusManager, rakeOutCommand, rakeOutPriceControllerCallback);
    }
}
module.exports = RakeOutControllerFactory
